import React from "react";
import { Col, Container, Row } from "react-bootstrap";
import Layout from "../../components/Layout";

function Website() {
  return (
    <Layout>
      <Container>
        <Row>
          <Col>
            <h3>Websites</h3>
          </Col>
          <Col>
            <button>Add</button>
          </Col>
        </Row>
      </Container>
    </Layout>
  );
}

export default Website;
